import React, { useEffect, useState } from "react";
import "../App.css";
import logo from '../images/hand-book-logo-illustration-art-background-43965136.webp'

const Header = () => {
  return (
    <div className="header">
      <div>
        <p>Home</p>
        <p>Books</p>
        <p>Students</p>
      </div>
    </div>
  );
};

export default Header;
